import React from 'react';
import './Login.css';

const Login = () => {
    return (
        <div id="login-wrapper">
            <form id="login-form">
                <label>Username</label>
                <input type="text" />
                <label>Password</label>
                <input type="password" /> 
            </form>
        </div>
    )
}

export default Login;
